import React from 'react';
// import CaseImages from '.../CaseImages';

export default function CaseStudyCard(props) {
    return (
        <div>
            <div className="px-10 flex flex-col items-center">
                <img className="rounded-sm pb-2 w-64 h-64" src={props.image} alt={props.alt}/>
                <h3 className="space-y-4 pr-28 text-white font-bold">{props.header}</h3>
            </div>
        </div>
        )
};
